// 自动初始化 DRACOLoader（若页面已加载 THREE/GLTFLoader）
(function(){
	try{
	var dracoPath = 'https://ssm-smart.github.io/axure/three/';
	// 如果全局已有 DRACOLoader 构造函数，直接使用；否则尝试动态加载 DRACOLoader.js
	var DRACOCtor = (typeof THREE !== 'undefined' && THREE.DRACOLoader) ? THREE.DRACOLoader : (typeof DRACOLoader !== 'undefined' ? DRACOLoader : null);
		function setupDracoCtor(Ctor){
			try{
				var draco = new Ctor();
				if (typeof draco.setDecoderPath === 'function') draco.setDecoderPath(dracoPath);
				if (typeof draco.preload === 'function') draco.preload();
				// 暴露用于其它脚本调用
				try{ window.__AX_DRACO_LOADER = draco; }catch(e){}
				return true;
			}catch(e){
				return false;
			}
		}
		if (DRACOCtor){
			setupDracoCtor(DRACOCtor);
		}else if (typeof document !== 'undefined'){
			// 动态加载 DRACOLoader.js，再设置 decoder 文件路径
			var s = document.createElement('script');
			s.src = dracoPath + 'DRACOLoader.js';
			s.onload = function(){
				var C = (typeof THREE !== 'undefined' && THREE.DRACOLoader) ? THREE.DRACOLoader : (typeof DRACOLoader !== 'undefined' ? DRACOLoader : null);
				if (C){
					if (!setupDracoCtor(C)) console.warn('DRACOLoader init failed');
				}else{
					console.warn('DRACOLoader not found after loading script');
				}
				// 额外尝试加载 wasm/decoder 文件名（draco_decoder.js）以兼容旧 loader
				var s2 = document.createElement('script');
				s2.src = dracoPath + 'draco_decoder.js';
				s2.onload = function(){};
				s2.onerror = function(){};
				document.head.appendChild(s2);
			};
			s.onerror = function(){ console.warn('Failed to load DRACOLoader.js from ' + dracoPath); };
			document.head.appendChild(s);
		}
	}catch(e){}
})();
